    [],nt"revision_timestamp": "2013-03-15T11:49:01.077619",nt"name": "accuracy-assessment-points-for-natural-bridges-national-monument-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "This point file displays the 288 accuracy
    assessment (AA) points visited in the fall of 2004 as part of the vegetation mapping
    project. The points were randomly selected, stratified by the map units used for
    vegetation mapping and further screened so as not to fall on inaccessible isolated
    mesa tops and vertical canyon walls. The coordinates were uploaded to Garmin hand-held
    GPS receivers so that ecologists could navigate to them in the field. Some AA points
    fell on ecotones and two sets of data were recorded on the evenly-split site. AA
    points that fell along polygon edges sometimes did not represent the entire polygon
    well and some AA points fell on small patches of vegetation that were different
    than the community in the larger area.",nt"license_title": null,nt"extras":
